import React from 'react';
import styled from 'styled-components';

const Element = styled.p`
    display: inline-block;
    text-overflow: ellipsis;
    word-wrap: break-word;
    overflow: hidden;
    max-height: 3.75em;
    line-height: 1.25em;
`;

const Accordion = (props) => {
    return (
        <Element {...props}>
            {props.children}
        </Element>
    );
}

export default Accordion;
